import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Header = ()=>{
    return (
       <>
        <ul>
            <li>apple <Button color="primary"><DeleteIcon /></Button></li>
            <li>apple <Button color="primary"><DeleteIcon /></Button></li>
            <li>apple <Button color="primary"><DeleteIcon /></Button></li>
            <li>apple <Button color="primary"><DeleteIcon /></Button></li>
            <li>apple <Button color="primary"><DeleteIcon /></Button></li>
        </ul>
       </>
    );
}

 export default Header;
